import { useEffect } from "react";
import axiosInstance from "../utils/axios";
import { useState } from "react";
import {
  MDBTabsContent,
  MDBBtn,
  MDBInput,
  MDBValidation,
  MDBValidationItem,
}
  from 'mdb-react-ui-kit';
  import Header from '../components/header';

function AddDebts() {

  interface FormData {
    debtName: string;
    lender: string;
    amount: number;
    interestRate: number;
    total: number;
    startingDate: Date;
    installment: number;
    explanation: string;
  }

  const [error, setError] = useState('')
  const [formData, setFormData] = useState<FormData>({
    debtName: '',
    lender: '',
    amount: 0,
    interestRate: 0,
    total: 0,
    startingDate: new Date(),
    installment: 0,
    explanation: '',
  })

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = async () => {



    const response = await axiosInstance.get('/finance/debt');
    if (response.data.status === 'success') {



    } else if (response.data.status === 'error') {

    }

  }

  return (

    <div className="bg-light pages">
    <Header />
      <div>Add Debt</div>
      {error && <div className='error-message'>{error}</div>}
      <div></div>
      <MDBTabsContent >
        <MDBValidation onSubmit={handleSubmit} className='px-4'>
          <MDBValidationItem feedback='Please enter Debt Name' invalid className='form-item'>
            <span>Debt Name</span>
            <MDBInput wrapperClass='mb-4' required  name='debtName' type='text' value={formData.debtName} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Lender' invalid className='form-item'>
          <span>Lender</span>
            <MDBInput wrapperClass='mb-4' required name='lender' type='text' value={formData.lender} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Amount' invalid className='form-item'>
          <span>Amount</span>
            <MDBInput wrapperClass='mb-4' required  name='amount' type='number' value={formData.amount} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Interest Rate' invalid className='form-item'>
          <span>Interest Rate</span>
            <MDBInput wrapperClass='mb-4' required  name='interestRate' type='number' value={formData.interestRate} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Total' invalid className='form-item'>
          <span>Total</span>
            <MDBInput wrapperClass='mb-4' required  name='total' type='number' value={formData.total} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Starting Date' invalid className='form-item'>
            <span>Starting Date</span>
            <MDBInput wrapperClass='mb-4' required name='startingDate' type='date'  value={formData.startingDate.toISOString().split('T')[0]}  onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter Installment' invalid className='form-item'>
            <span>Installment</span>
            <MDBInput wrapperClass='mb-4' required  name='installment' type='number' value={formData.installment} onChange={handleChange} />
          </MDBValidationItem>
          <MDBValidationItem feedback='Please enter name Explanation' invalid className='form-item'>
            <span>Explanation</span>
            <MDBInput wrapperClass='mb-4' required  name='explanation' type='number' value={formData.explanation} onChange={handleChange} />
          </MDBValidationItem>
          <MDBBtn type="submit" className="mb-4 w-100">Create Payment Plan</MDBBtn>
        </MDBValidation>
      </MDBTabsContent>
    </div>
  );
}

export default AddDebts;
